import React from 'react';

const Rank = ({name}, {entries}) => {
   return (
      <div>
         <div className='white f3 mt3'>
            ${name}
         </div>
         <div className='white f2'>
            Your current rank is ${entries}!
         </div>
      </div>
   );
}

export default Rank;
